import React, { useState } from "react";
import { FaPlus } from "react-icons/fa";

const Content = () => {
    const [items, setItems] = useState({});
    return (
        <main>
            <input
                type="text"
                required
                autoFocus
                placeholder="Add Item"
                onChange={() => { }}
            />
            <button type="submit" aria-label="Add item">
                <FaPlus />
            </button>
        </main>
    );
};

export default Content;
